import React, {useState, useEffect} from 'react';
import searchImg from './Images/searchImage.png';
import './Search.css';


function returnSearch() {
    let input = document.getElementById('searchpart').value;
    $.ajax({
        url: '/api/members',
        type: 'POST',
        contentType: 'application/json',
        data: JSON.stringify({'value': input}),
        success: alert('Success!'),
        error: function(error) {
            console.log(error)
        }
    });
    alert(input);
}

function Search() {

    return (
        <div className = "search">
            <div className = "row">
                <div className = "Search-Middle">
                    <button id="searchButton" onClick={returnSearch}>

                    </button>
                </div>
                <div className = "Search-Middle">
                    <form className='searchBar'>
                        <input id='searchpart' className='searchInput' type='text' placeholder='Search here...'/>
                    </form>
                </div>
                <br />
                <div className = "Search-Middle">
                    <p></p>
                </div>
                <div className = "Search-Middle">
                    <p></p>
                </div>
            </div>
        </div>
  );
}

export default Search;
